import React from "react";
import Box from "@mui/material/Box";
import TextField from "@mui/material/TextField";
import Button from "@mui/material/Button";
import SendIcon from "@mui/icons-material/Send";
import Grid from "@mui/material/Grid";
// import List from "@mui/material/List";
// import ListItem from "@mui/material/ListItem";
// import ListItemText from "@mui/material/ListItemText";
import Typography from "@mui/material/Typography";
// import { styled } from "@mui/material/styles";
// import Paper from "@mui/material/Paper";

import FormControl from "@mui/material/FormControl";
import InputLabel from "@mui/material/InputLabel";
// import InputBase from "@mui/material/InputBase";
import MenuItem from "@mui/material/MenuItem";
import Select from "@mui/material/Select";

import FormGroup from "@mui/material/FormGroup";
import FormControlLabel from "@mui/material/FormControlLabel";
import Checkbox from "@mui/material/Checkbox";
import Switch from "@mui/material/Switch";

import Divider from "@mui/material/Divider";

// import Paper from "@mui/material/Paper";

import Card from "@mui/material/Card";
import CardActions from "@mui/material/CardActions";
import CardContent from "@mui/material/CardContent";

// import { styled } from "@mui/material/styles";
// import Stack from "@mui/material/Stack";

class forms extends React.Component {
  constructor() {
    super();
    this.state = {
      items: [],
    };
  }

  render() {
    console.log(this.props.itemCf);
    return (
      <>
        <Divider>
          {" "}
          <Typography variant="h5" component="h5">
            {" "}
            Personal Information{" "}
          </Typography>
        </Divider>
        <Box id="fullWidth">
          <Grid container spacing={2}>
            <Grid item xs={8}>
              <InputLabel>
                Philhealth Identification No. (PIN) Member :
              </InputLabel>
              <TextField
                id="outlined-multiline-flexible"
                // label="Multiline"
                // multiline
                // maxRows={4}
                value={this.props.itemCf.pMemberPIN}
                fullWidth
                name="pMemberPIN"
                size="small"
                onChange={this.props.onchange}
              />
            </Grid>
            <Grid item xs={4}>
              {" "}
            </Grid>
            <Grid item xs={12}>
              <InputLabel>Name of Member</InputLabel>{" "}
            </Grid>
            <Grid item xs={3}>
              <TextField
                id="outlined-multiline-flexible"
                label="Last Name"
                // multiline
                // maxRows={4}
                fullWidth
                value={this.props.itemCf.pMemberLastName}
                name="pMemberLastName"
                size="small"
                onChange={this.props.onchange}
              />
            </Grid>
            <Grid item xs={3}>
              <TextField
                id="outlined-multiline-flexible"
                label="First Name"
                // multiline
                // maxRows={4}
                fullWidth
                name="pMemberFirstName"
                value={this.props.itemCf.pMemberFirstName}
                size="small"
                onChange={this.props.onchange}
              />
            </Grid>
            <Grid item xs={2}>
              <TextField
                id="outlined-multiline-flexible"
                label="Extension Name"
                // multiline
                // maxRows={4}
                fullWidth
                size="small"
                name="pMemberSuffix"
                value={this.props.itemCf.pMemberSuffix}
                onChange={this.props.onchange}
              />
            </Grid>
            <Grid item xs={2}>
              <TextField
                id="outlined-multiline-flexible"
                label="Middle Name"
                // multiline
                // maxRows={4}
                fullWidth
                name="pMemberMiddleName"
                value={this.props.itemCf.pMemberMiddleName}
                size="small"
                onChange={this.props.onchange}
              />
            </Grid>
            <Grid item xs={2}>
              <TextField
                id="outlined-multiline-flexible"
                label="Date of Birth"
                // multiline
                // maxRows={4}
                type="date"
                InputLabelProps={{ shrink: true, required: true }}
                fullWidth
                value={this.props.itemCf.pMemberBirthDate}
                name="pMemberBirthDate"
                size="small"
                onChange={this.props.onchange}
              />
            </Grid>
            <Grid item xs={12}>
              <InputLabel>Member Category</InputLabel>
              <TextField
                id="outlined-multiline-flexible"
                // label="Middle Name"
                // multiline
                // maxRows={4}
                fullWidth
                name="pMemberShipType"
                value={this.props.itemCf.pMemberShipType}
                size="small"
                onChange={this.props.onchange}
              />
            </Grid>
            <Grid item xs={7}>
              <TextField
                id="outlined-multiline-flexible"
                label="Mailing Address"
                // multiline
                // maxRows={4}
                fullWidth
                name="pMailingAddress"
                value={this.props.itemCf.pMailingAddress}
                size="small"
                onChange={this.props.onchange}
              />
            </Grid>{" "}
            <Grid item xs={2}>
              <TextField
                id="outlined-multiline-flexible"
                label="Zip Code"
                // multiline
                // maxRows={4}
                fullWidth
                name="pZipCode"
                value={this.props.itemCf.pZipCode}
                size="small"
                onChange={this.props.onchange}
              />
            </Grid>{" "}
            <Grid item xs={3}>
              <FormControl fullWidth>
                <InputLabel id="demo-simple-select-label">Gender</InputLabel>
                <Select
                  labelId="demo-simple-select-label"
                  id="demo-simple-select"
                  // value={age}
                  label="Gender"
                  size="small"
                  value={this.props.itemCf.pMemberSex}
                  name="pMemberSex"
                  onChange={this.props.onchange}
                  // onChange={handleChange}
                >
                  <MenuItem value={1}>Male</MenuItem>
                  <MenuItem value={2}>Female</MenuItem>
                </Select>
              </FormControl>
            </Grid>
            <Grid item xs={12}>
              <InputLabel>Contact Information</InputLabel>{" "}
            </Grid>
            <Grid item xs={3}>
              <TextField
                id="outlined-multiline-flexible"
                label="Landline No."
                // multiline
                // maxRows={4}
                fullWidth
                name="pLandlineNo"
                value={this.props.itemCf.pLandlineNo}
                size="small"
                onChange={this.props.onchange}
              />
            </Grid>
            <Grid item xs={3}>
              <TextField
                id="outlined-multiline-flexible"
                label="Mobile No."
                // multiline
                // maxRows={4}
                fullWidth
                name="pMobileNo"
                value={this.props.itemCf.pMobileNo}
                size="small"
                onChange={this.props.onchange}
              />
            </Grid>
            <Grid item xs={6}>
              <TextField
                id="outlined-multiline-flexible"
                label="Email Address"
                // multiline
                // maxRows={4}
                fullWidth
                name="pEmailAddress"
                value={this.props.itemCf.pEmailAddress}
                size="small"
                onChange={this.props.onchange}
              />
            </Grid>
          </Grid>

          <br />
          <Divider>
            {" "}
            <Typography variant="h6" component="h6">
              {" "}
              Patient Information{" "}
            </Typography>
          </Divider>

          <Grid container spacing={2}>
            <Grid item xs={8}>
              <InputLabel>
                Philhealth Identification No. (PIN) of Dependent :
              </InputLabel>
              <TextField
                id="outlined-multiline-flexible"
                // label="Multiline"
                // multiline
                // maxRows={4}
                value={this.props.itemCf.pMemberPIN}
                fullWidth
                name="pMemberPIN"
                size="small"
                onChange={this.props.onchange}
              />
            </Grid>
            <Grid item xs={4}>
              {" "}
            </Grid>
            <Grid item xs={12}>
              <InputLabel>Name of the Patient</InputLabel>{" "}
            </Grid>
            <Grid item xs={3}>
              <TextField
                id="outlined-multiline-flexible"
                label="Last Name"
                // multiline
                // maxRows={4}
                fullWidth
                value={this.props.itemCf.pMemberLastName}
                name="pMemberLastName"
                size="small"
                onChange={this.props.onchange}
              />
            </Grid>
            <Grid item xs={3}>
              <TextField
                id="outlined-multiline-flexible"
                label="First Name"
                // multiline
                // maxRows={4}
                fullWidth
                name="pMemberFirstName"
                value={this.props.itemCf.pMemberFirstName}
                size="small"
                onChange={this.props.onchange}
              />
            </Grid>
            <Grid item xs={2}>
              <TextField
                id="outlined-multiline-flexible"
                label="Extension Name"
                // multiline
                // maxRows={4}
                fullWidth
                size="small"
                name="pMemberSuffix"
                value={this.props.itemCf.pMemberSuffix}
                onChange={this.props.onchange}
              />
            </Grid>
            <Grid item xs={2}>
              <TextField
                id="outlined-multiline-flexible"
                label="Middle Name"
                // multiline
                // maxRows={4}
                fullWidth
                name="pMemberMiddleName"
                value={this.props.itemCf.pMemberMiddleName}
                size="small"
                onChange={this.props.onchange}
              />
            </Grid>
            <Grid item xs={2}>
              <TextField
                id="outlined-multiline-flexible"
                label="Date of Birth"
                // multiline
                // maxRows={4}
                type="date"
                InputLabelProps={{ shrink: true, required: true }}
                fullWidth
                value={this.props.itemCf.pMemberBirthDate}
                name="pMemberBirthDate"
                size="small"
                onChange={this.props.onchange}
              />
            </Grid>
            <Grid item xs={2}>
              <TextField
                id="outlined-multiline-flexible"
                label="Zip Code"
                // multiline
                // maxRows={4}
                fullWidth
                name="pZipCode"
                value={this.props.itemCf.pZipCode}
                size="small"
                onChange={this.props.onchange}
              />
            </Grid>{" "}
            <Grid item xs={3}>
              <FormControl fullWidth>
                <InputLabel id="demo-simple-select-label">Gender</InputLabel>
                <Select
                  labelId="demo-simple-select-label"
                  id="demo-simple-select"
                  // value={age}
                  label="Gender"
                  size="small"
                  value={this.props.itemCf.pMemberSex}
                  name="pMemberSex"
                  onChange={this.props.onchange}
                  // onChange={handleChange}
                >
                  <MenuItem value={1}>Male</MenuItem>
                  <MenuItem value={2}>Female</MenuItem>
                </Select>
              </FormControl>
            </Grid>
          </Grid>
          <br />
          <Divider>
            {" "}
            <Typography variant="h6" component="h6">
              {" "}
              Member Certification{" "}
            </Typography>
          </Divider>

          <br />
          <Grid container spacing={2}>
            <Grid item xs={3}>
              - With signature of member?{" "}
            </Grid>
            <Grid item xs={3}>
              <FormGroup>
                {/* <FormControlLabel label="YES" labelPlacement="start"/> */}
                <FormControlLabel control={<Switch />} label="YES ?" />
                {/* <FormControlLabel label="NO" labelPlacement="end"/> */}
              </FormGroup>
            </Grid>

            <Grid item xs={3}>
              Date Signed
            </Grid>
            <Grid item xs={3}>
              <TextField
                id="outlined-multiline-flexible"
                label=""
                // multiline
                // maxRows={4}
                type="date"
                fullWidth
                value={this.props.itemCf.pEmailAddress}
                name="pEmailAddress"
                size="small"
                onChange={this.props.onchange}
              />
            </Grid>
            <Grid item xs={3}>
              - With signature of member's representative?{" "}
            </Grid>
            <Grid item xs={3}>
              <FormGroup>
                {/* <FormControlLabel label="YES" labelPlacement="start"/> */}
                <FormControlLabel control={<Switch />} label="YES ?" />
                {/* <FormControlLabel label="NO" labelPlacement="end"/> */}
              </FormGroup>
            </Grid>

            <Grid item xs={3}>
              Date Signed
            </Grid>

            <Grid item xs={3}>
              <TextField
                id="outlined-multiline-flexible"
                label=""
                // multiline
                // maxRows={4}
                fullWidth
                type="date"
                value={this.props.itemCf.pEmailAddress}
                name="pEmailAddress"
                size="small"
                onChange={this.props.onchange}
              />
            </Grid>
            <Grid item xs={3}>
              - Relationship of the Representative of the Member?{" "}
            </Grid>
            <Grid item xs={3}>
              <FormGroup>
                {/* <FormControlLabel label="YES" labelPlacement="start"/> */}
                <FormControlLabel control={<Switch />} label="YES ?" />
                {/* <FormControlLabel label="NO" labelPlacement="end"/> */}
              </FormGroup>
            </Grid>

            <Grid item xs={3}>
              Date Signed
            </Grid>
            <Grid item xs={3}>
              <TextField
                id="outlined-multiline-flexible"
                label=""
                // multiline
                // maxRows={4}
                fullWidth
                type="date"
                name="pEmailAddress"
                size="small"
                onChange={this.props.onchange}
              />
            </Grid>
            <Grid item xs={3}>
              - Reason for Signing on Behalf of the member{" "}
            </Grid>
            <Grid item xs={3}>
              <FormGroup>
                {/* <FormControlLabel label="YES" labelPlacement="start"/> */}
                <FormControlLabel
                  control={<Switch />}
                  label="Member is Incapacitated"
                />
                {/* <FormControlLabel label="NO" labelPlacement="end"/> */}
              </FormGroup>
            </Grid>

            <Grid item xs={3}>
              Other Reason
